  .enter()
  .append("circle")
  .attr("cx", d => x(d['Bank Internal Score']))
  .attr("cy", d => y(d['FinScore Telco']))
  .attr("r", 4)
  .attr("fill-opacity", 0.7);

function update(threshold) {
  document.getElementById('threshVal').textContent = threshold;
  const bankCut = 5;
  let accepted = 0, defaults = 0;

  dots.attr("fill", d => {
    const bankPass = d['Bank Internal Score'] >= bankCut;
    const telcoPass = d['FinScore Telco'] >= threshold;
    if (bankPass && telcoPass) {
      accepted++;
      if (d['Good/Bad Flag'] === 0) defaults++;
      return d['Good/Bad Flag'] === 1 ? "#2ecc71" : "#e74c3c";
    } else if (bankPass && !telcoPass) {
      return "#3498db";
    } else {
      return "#bdc3c7";
    }
  });

  const acceptRate = (accepted / data.length * 100).toFixed(1);
  const defaultRate = accepted ? (defaults / accepted * 100).toFixed(1) : "–";
  document.getElementById('acceptRate').textContent = `Acceptance Rate: ${acceptRate}%`;
  document.getElementById('defaultRate').textContent = `Default Rate: ${defaultRate}%`;
}

document.getElementById('threshold').addEventListener('input', e => {
  update(+e.target.value);
});

let t = 0;
function autoChange() {
  document.getElementById('threshold').value = t;
  update(t);
  t = (t + 1) % 11;
}
update(0);
setInterval(autoChange, 3000);
</script>
</body>
</html>
